import React from 'react'

class Compare extends React.Component {
    constructor(props) {
        super(props);
        this.state = {apikey: this.props.apikey, date: this.props.date, result: ''};
    }
    getBrands(){
        var myHeaders = new Headers();
        myHeaders.append("Content-Type", "application/json");

        var raw = JSON.stringify({"apikey":this.props.apikey,"method":"partner_api.get_brands","params":{"projectname":"Automotive"}});

        var requestOptions = {
        method: 'POST',
        headers: myHeaders,
        body: raw,
        redirect: 'follow'
        };

        fetch("http://localhost:3001/requests", requestOptions)
        .then(response => this.response = response.json())
        .then(result => console.log(result))
        .catch(error => console.log('error', error));
    }
    render() {
        return (
            <div>
                <button className="btn btn-primary mt-5"
                        onSubmit={this.getBrands}>Get data</button>
                <h3>{this.response}</h3>
            </div>
        )
    }
}

export default Compare;
